import React from 'react'
import { View, StyleSheet, Text, TextInput } from "react-native";


const Input = (props) => {
    return 
        <TextInput style={{...styles.input, ...props.style }} />;
            
       
  
}

export default Input
const styles = StyleSheet.create({
    input: {
      height: 30,
      borderBottomColor: "grey",
      borderBottomWidth:1,
      marginVertical:10
    },
  });
